import React, { useState, Dispatch, SetStateAction } from 'react'

export type UserLoggedContextType = {
  UserLogged: boolean;
  setUserLogged: Dispatch<SetStateAction<boolean>>;
};

export const UserLoggedContext = React.createContext<UserLoggedContextType>({
  UserLogged: false,
  setUserLogged: text => console.warn('no Product text'),
});

export const UserLoggedProvider: React.FC = ({ children }) => {
  const [UserLogged, setUserLogged] = useState(false);

  return (
    <UserLoggedContext.Provider value={{UserLogged, setUserLogged}}>
      {children}
    </UserLoggedContext.Provider>
  )
}
